CREATE DATABASE IceAndFireDB
GO

USE IceAndFireDB
GO

CREATE TABLE Users (
UserId INT NOT NULL IDENTITY(1000,1),  
UserName nvarchar(50) NOT NULL UNIQUE,
UserPass nvarchar(20) NOT NULL,
UserEmail nvarchar(128) NOT NULL,
UserPhoto nvarchar(MAX),
)
GO

ALTER TABLE Users ADD CONSTRAINT PK_name PRIMARY KEY (UserId,UserName)

CREATE TABLE Categories(
CatId INT NOT NULL IDENTITY(2000,1),  
CatName NVARCHAR(255) NOT NULL UNIQUE,  
CatDescript NVARCHAR(255),
)
GO

ALTER TABLE Categories ADD CONSTRAINT PK_cateName PRIMARY KEY (CatId,CatName)


CREATE TABLE Topics(
TopicId INT NOT NULL IDENTITY(3000,1),
TopicSubject NVARCHAR(255) NOT NULL UNIQUE, 
TopicDate SMALLDATETIME,
TopicContent TEXT,
CatName NVARCHAR(255),   
UserName nvarchar(50),     
)
GO

ALTER TABLE Topics ADD CONSTRAINT PK_TopicName PRIMARY KEY (TopicId,TopicSubject)

ALTER TABLE Topics ADD CONSTRAINT FK_UserName FOREIGN KEY (UserName)
	REFERENCES [dbo].[Users]([UserName])
	ON DELETE CASCADE
	ON UPDATE CASCADE
	GO

ALTER TABLE Topics ADD CONSTRAINT FK_CatName FOREIGN KEY (CatName)
	REFERENCES [dbo].[Categories]([CatName])
	ON DELETE CASCADE
	ON UPDATE CASCADE
	GO


CREATE TABLE Replies(
ReplyId INT PRIMARY KEY NOT NULL IDENTITY(4000,1),
ReplyContent TEXT,
ReplyDate SMALLDATETIME,
TopicSubject NVARCHAR(255) NOT NULL,  
UserName nvarchar(50) NOT NULL    
)
GO

ALTER TABLE Replies ADD CONSTRAINT FK_RepUserName FOREIGN KEY (UserName)
	REFERENCES [dbo].[Users]([UserName])
	ON DELETE CASCADE
	ON UPDATE CASCADE
	GO

ALTER TABLE Replies ADD CONSTRAINT FK_RepTopic FOREIGN KEY (TopicSubject)
	REFERENCES [dbo].[Topics]([TopicSubject])
	GO


